package com.srd.ljzd.entity.relationCompanyAndPerson;

public class RelationCompanyAndPerson implements java.io.Serializable{

 private static final long serialVersionUID = 1L;
 private String    id;
 private String    companyNameInProperties;
 private String    personNameInProperties;
 private String    labels;
 private String    tsInProperties;
 private boolean existFlag;
 
 
public RelationCompanyAndPerson() {
	super();
	// TODO Auto-generated constructor stub
}
public RelationCompanyAndPerson(String id, String companyNameInProperties,
		String personNameInProperties, String labels, String tsInProperties) {
	super();
	this.id = id;
	this.companyNameInProperties = companyNameInProperties;
	this.personNameInProperties = personNameInProperties;
	this.labels = labels;
	this.tsInProperties = tsInProperties;
}
public String getId() {
	return id;
}
public void setId(String id) {
	this.id = id;
}
public String getCompanyNameInProperties() {
	return companyNameInProperties;
}
public void setCompanyNameInProperties(String companyNameInProperties) {
	this.companyNameInProperties = companyNameInProperties;
}
public String getPersonNameInProperties() {
	return personNameInProperties;
}
public void setPersonNameInProperties(String personNameInProperties) {
	this.personNameInProperties = personNameInProperties;
}
public String getLabels() {
	return labels;
}
public void setLabels(String labels) {
	this.labels = labels;
}
public String getTsInProperties() {
	return tsInProperties;
}
public void setTsInProperties(String tsInProperties) {
	this.tsInProperties = tsInProperties;
}

public String toString(){
	
	return "companyName==="+this.companyNameInProperties+";personName==="+this.personNameInProperties+"==== lables=="+this.getLabels();
}
public boolean isExistFlag() {
	return existFlag;
}
public void setExistFlag(boolean existFlag) {
	this.existFlag = existFlag;
}
 
 
 

}
